import React from 'react';
import logo from './logo.svg';
import './App.css';
// Route를 먼저 불러와줍니다.
import { Routes, Route } from "react-router-dom";

import SchedulePage from "./components/SchedulePage";
import EnterScheduleInformation from "./components/EnterScheduleInformation";
import ExpenseCalculationAndSupplies from "./components/ExpenseCalculationAndSupplies";
import PlannerWeather from "./components/PlannerWeather";
import Transport from "./components/Transport";
import ScheduleItem from "./components/ScheduleItem";

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={};
  }

  render(){

    return (
      <div>
        <Routes>
          <Route path="/" exact component={SchedulePage} />
          <Route path="/c" exact component={ExpenseCalculationAndSupplies} />
        </Routes>

        <SchedulePage>

        </SchedulePage>
      </div>
    );
  }
}

export default App;
